import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminPanel = () => {
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    axios.get('/api/bookings', { params: { role: 'admin' } }).then(res => {
      if (res.data.success) {
        setBookings(res.data.bookings);
      }
    });
  }, []);

  return (
    <div>
      <h2>Admin Panel - All Bookings</h2>
      <table border="1" cellPadding="5" cellSpacing="0">
        <thead>
          <tr>
            <th>Booking ID</th>
            <th>Username</th>
            <th>Seat Name</th>
            <th>Train Name</th>
            <th>Time Slot</th>
            <th>Source City</th>
            <th>Destination City</th>
          </tr>
        </thead>
        <tbody>
          {bookings.map(booking => (
            <tr key={booking.id}>
              <td>{booking.id}</td>
              <td>{booking.username}</td>
              <td>{booking.seat_name}</td>
              <td>{booking.train_name}</td>
              <td>{booking.time_slot}</td>
              <td>{booking.source_city_name}</td>
              <td>{booking.destination_city_name}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AdminPanel;
